export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},REDRvwePfP:{data:{id:934,attributes:{imdbId:"tt8178486",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDA2NjRkNTktMDg3YS00OTVhLTlmOGMtYWZkMGQyYjVhZjJhXkEyXkFqcGdeQXVyMDM2NDM2MQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.9\u002F10"},{Source:"Rotten Tomatoes",Value:"49%"},{Source:"Metacritic",Value:"51\u002F100"}],item_lang:{data:{id:1597,attributes:{title:"Earthquake Bird",plot:"In 1989 Tokyo, Lucy Fly, an enigmatic expat haunted by a painful past, enters into an intense relationship with Teiji, a handsome yet similarly troubled local photographer. Lucy's imperturbable exterior begins to crack when a naive newcomer, Lily Bridges, becomes entangled in their lives and ends up missing - suspected dead.",slug:"earthquake-bird"}}},books:{data:[{id:5571,attributes:{title:e,description:h,thumbnail:i,authors:[a],firstBook:true,published:j,publisher:k,subtitle:l}},{id:5572,attributes:{title:e,description:h,thumbnail:i,authors:[a],firstBook:c,published:j,publisher:k,subtitle:l}},{id:5573,attributes:{title:e,description:"Lucy Fly, an Englishwoman living in Japan, is questioned by the police in the murder of Lily Bridges, a fellow Brit and romantic rival.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IXzdoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2014-07-02",publisher:d,subtitle:d}},{id:5574,attributes:{title:"Earthquake bird",description:"FARAN I ATT INTE TRO PÅ SIG SJÄLV Lucy har flytt till Tokyo för att undkomma det förflutna. För att inte bli upptäckt lever hon ett tillbakadraget liv, med få vänner, och en älskare som väger upp bristen på all annan passion. Sedan träffar hon Lily som har kopplingar till hennes tidigare liv. Vänskapen blir intensiv, men kort därpå mördas Lily och Lucy är den enda som är misstänkt. I jakten på att rentvå sig själv fångas Lucy i minnets förrädiska labyrinter. Det blir en suggestiv katt- och råtta lek där läsaren, liksom Lucy, hålls på sträckbänken ifråga om hennes skuld – eller oskuld. EARHTQUAKE BIRD har utmärkts med fyra litterära priser. Filmen med ALICIA VIKANDER som bygger på romanen av SUSANNA JONES är adapterad och regisserad av WASH WESTMORELAND. SUSANNA JONES är en brittisk författare med fem kritikerrosade romaner bakom sig. Efter dramastudier vid Londons universitet bodde och arbetade hon i Japan i flera år. För Earthquake bird har hon förärats en John Creasy Award, en Betty Trask Award, ett Mail on Sunday Prize och en CWA New Blood Dagger. Boken är översatt till mer än 20 språk.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6CW-DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2019-11-11",publisher:"Bookmark Förlag",subtitle:d}},{id:5575,attributes:{title:"Water Lily",description:"Runa is a young Japanese high school teacher leaving the country to avoid the scandal she has created by sleeping with one of her students. She steals her sister’s passport and boards the ferry to Shanghai. Then, careful to impersonate her sister, she is quiet, docile and discreet... Meanwhile, on the last stretch of a fraught and tiring mission to find a wife, an Englishman also boards the ferry. Rebuffed in Tokyo, Ralph hopes that on the Chinese mainland he will meet a gentle, beautiful girl to return home with. When these two meet, suppressing at first their secrets and obsessions on this long and claustrophobic journey, we enter a desolate, emotional landscape as Runa’s journey begins to turn into a surreal and terrifying nightmare . . .",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RJ9-X1OKrGMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2011-08-19",publisher:"Pan Macmillan",subtitle:d}}]}}},meta:{}}},prerenderedAt:1681309480852}}("Susanna Jones","movie",null,"","The Earthquake Bird","series",1,"Now a major Netflix film starring Alicia Vikander and Riley Keough, a haunting psychological thriller set in Tokyo probing deep into the mind of a murder suspect The grisly headline leaves nothing to the imagination: \"Woman's torso recovered from Tokyo Bay. Believed to be missing British bartender Lily Bridges.\" The only suspect is Lucy Fly. Her friend is dead, her lover has disappeared, and as far as anyone is concerned, she's as good as guilty. Trapped in the interrogation room, Lucy begins to unravel two stories. One, for the police, is a spare outline, offering more questions than answers. The other--the real one, if you believe her--is a gripping dive into an obsessive mind, revealing the checkered past that brought her to Japan, her complicated friendship with Lily, and a tempestuous affair with a missing Japanese photographer named Teiji. As she excavates the dangerous secrets--both past and present--that haunt her waking mind, Lucy relates an unsettling life story that spans bustling Tokyo, the British countryside, and remote Japanese islands, each step taking us closer to the chilling truth about Lily's death. An all-consuming crime story like no other, Susanna Jones's mesmerizing debut novel is a neo-noir thriller as shocking as it is exquisitely composed. \"Novels of psychological suspense hang on the delicacy of the writer's touch--that feathery brushstroke that darkens a mood, heightens an action and brings a revealing word to a character's lips--and Susanna Jones has the touch.\"--Marilyn Stasio, The New York Times","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HCmrDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2019-09-10","Penguin","A Novel"))